package org.ehu.jgabilondo.dma;

public class Emaitza {

	private int hilKopurua;
	private int zaurituKopurua;
	
	public Emaitza() {
		// TODO Auto-generated constructor stub
	}

	public Emaitza(int hilKopurua, int zaurituKopurua) {
		this.hilKopurua = hilKopurua;
		this.zaurituKopurua = zaurituKopurua;
	}
	
	public int getHilKopurua() {
		return hilKopurua;
	}

	public void setHilKopurua(int hilKopurua) {
		this.hilKopurua = hilKopurua;
	}

	public int getZaurituKopurua() {
		return zaurituKopurua;
	}

	public void setZaurituKopurua(int zaurituKopurua) {
		this.zaurituKopurua = zaurituKopurua;
	}
	
	

}
